import React from "react";
import ThemeToggle from "./ThemeToggle";
import DropboxSync from "./DropboxSync";

// You can add more features/components as needed

export default function FeaturePanel(props) {
  return (
    <section className="feature-panel">
      <div className="feature-row">
        <ThemeToggle />
        <DropboxSync {...props} compact />
        {/* Add more feature buttons/components here as needed */}
      </div>
      <div className="feature-row">
        {/* Example: Export/Import, Lock, Change Password, Badges, etc. */}
        {props.children}
      </div>
    </section>
  );
}
